import React, { useState, useEffect } from "react";
//import { Home } from './containers/Home';

function App() {
    const[data, setData] = useState([{}]);

    useEffect(() => {
        fetch("http://127.0.0.1:5000/data", { method: 'get', mode: 'cors' }).then(
            res => res.json()
        ).then(
            data => {
                setData(data)
                console.log(data)
            }
        );
    }, []);

    return (
        <div className="App">
            <header className="App-header">
                <h1>React showing data from flask</h1>
            </header>
        </div>
    );
}

export default App;
